import React, { useEffect,useState } from 'react';
import axios from 'axios';

function App() {

  const [todo,setTodo] = useState(["Hey","Alişan","Ne Haber"]);

  useEffect(() => {
     getData();
  },[])

  const getData = () => {
    try {
      const data = axios.get("http://localhost:8080/todos/all");
      setTodo(data);
    } catch (error) {
      console.log(error);
    }
  }


  return (
    <div>
      {
        todo.map(item => {
          return(
            <li>{item}</li>
          )
        })
      }
    </div>
  )
}

export default App
